import React from "react";
import { useParams } from "react-router-dom";

function Profile() {
    let { userSlug } = useParams();
    return (
        <div className="user_profile">
            <div className="container">
                <h1>PROFILE de Audrey Yuna</h1>
            </div>
        </div>
    );
}

export default Profile;
